svg.script:
 window.onload = function () {
   var infobox = new infobox_obj();
 }

 function bind (scope, fn) {
   return function () {
     return fn.apply( scope, arguments );
   }
 }

 function infobox_obj() {
   this.data_template = {};
   this.data = [];
   this.root = document.documentElement;
   this.box = null;
   this.bg = null;
   this.hilite_clone = null;
   this.text_root = null;
   this.text_x = 7;
   this.text_y = 14;
   this.dy = "1.25em";

   this.coords = this.root.createSVGPoint();
   this.offset = this.root.createSVGPoint();
   this.offset.x = 7;
   this.offset.y = 7;

   this.box_style = "pointer-events:none;";
   // this.bg_style = "fill:whitesmoke; stroke:whitesmoke; fill-opacity:0.9;";
   // this.text_style = "font-family:Tahoma,sans-serif; font-size:10px; fill:rgb(90,90,90);";
   this.bg_style = "fill:#252525; stroke:#252525; fill-opacity:0.9;";
   this.text_style = "font-family:Tahoma,sans-serif; font-size:10px; fill:whitesmoke;";
   this.header_style = "font-size:1.2em; font-weight:bold;";

   this.init();
 }

 infobox_obj.prototype.init = function () {
   const svg_ns = "http://www.w3.org/2000/svg";

   this.box = document.createElementNS(svg_ns, "svg");
   this.box.setAttribute("style", this.box_style );
   this.box.setAttribute("id", "infobox");
   // this.box.setAttribute("width", "15%" );
   // this.box.setAttribute("height", "15%" );
   this.box.setAttribute("width", "25%" );
   this.box.setAttribute("height", "25%" );

   this.bg = document.createElementNS(svg_ns, "rect");
   this.bg.setAttribute("style", this.bg_style );
   this.bg.setAttribute("width", "100%" );
   this.bg.setAttribute("height", "100%" );
   this.box.appendChild(this.bg);

   this.text_root = document.createElementNS(svg_ns, "text");
   this.text_root.setAttribute("aria-live", "polite" );
   this.text_root.setAttribute("style", this.text_style );
   this.text_root.setAttribute("x", this.text_x);
   this.text_root.setAttribute("y", this.text_y);
   this.box.appendChild(this.text_root);

   var template = document.querySelector("[role=template]");
   var header = document.querySelector("[role=header]");
   this.data_template["header"] = {
     "selector": header.getAttribute("selector"),
     "label": header.textContent
   };
   var text_header = document.createElementNS(svg_ns, "tspan");
   text_header.setAttribute("id", "infobox_header");
   text_header.setAttribute("x", this.text_x);
   text_header.setAttribute("style", this.header_style );
   this.text_root.appendChild(text_header);

   this.data_template["items"] = [];

   var items = template.querySelectorAll("[role=item]");
   for (var i = 0, i_len = items.length; i_len > i; ++i) {
     var item = items[i];
     this.data_template["items"].push(
       {
         "selector": item.getAttribute("selector"),
         "label": item.textContent
       }
     );

     var text_name = document.createElementNS(svg_ns, "tspan");
     text_name.setAttribute("id", "infobox_name-" + i);
     text_name.setAttribute("x", this.text_x);
     text_name.setAttribute("dy", this.dy);
     text_name.setAttribute("style", "font-weight:bold;");
     text_name.textContent = item.textContent + ":";
     this.text_root.appendChild(text_name);

     var text_value = document.createElementNS(svg_ns, "tspan");
     text_value.setAttribute("id", "infobox_value-" + i);
     text_value.setAttribute("dx", "0.5em");
     text_value.setAttribute("style", "font-weight:normal;");
     text_name.appendChild(text_value);

     this.dy = "1em";
   }

   var regions = document.querySelectorAll("[role=datapoint]");
   for (var s = 0, s_len = regions.length; s_len > s; ++s) {
     var region_el = regions[s];
     region_el.addEventListener("focus", bind(this, this.show_info), false );
     region_el.addEventListener("mouseenter", bind(this, this.show_info), false );
     // region_el.addEventListener("mouseenter", bind(this, this.set_focus), false );
     region_el.addEventListener("blur", bind(this, this.hide_info), false );
     region_el.addEventListener("mouseleave", bind(this, this.hide_info), false );
     region_el.addEventListener("mousemove", bind(this, this.follow_cursor), false );

     var obj = [];
     obj["header"] = region_el.querySelector( this.data_template.header.selector ).textContent;
     for (var i = 0, i_len = this.data_template.items.length; i_len > i; ++i) {
       var item = this.data_template.items[i];
       obj.push(
         {
           "value": region_el.querySelector( item.selector ).textContent,
           "label": item.label
         }
       );
     }
     this.data[ region_el.id ] = obj;
   }

   this.box.style.display = "none";      
   document.documentElement.appendChild(this.box);
 }

 infobox_obj.prototype.set_focus = function ( event ) {
   event.target.focus();
 }

 infobox_obj.prototype.show_info = function ( event ) {

   var region = event.target;

   // highlight clone
   const svg_ns = "http://www.w3.org/2000/svg";
   this.hilite_clone = document.createElementNS(svg_ns, "use");
   this.hilite_clone.setAttributeNS("http://www.w3.org/1999/xlink", "href", "#" + region.id);
   this.hilite_clone.setAttribute("style", "stroke:black; stroke-width:5px; pointer-events:none;");
   this.root.insertBefore(this.hilite_clone, this.box);
     console.log(this.hilite_clone);

   var info = this.data[ region.id ];
   var item_el = this.box.querySelector("#infobox_header");
   item_el.textContent = info.header;

   for (var i = 0, i_len = info.length; i_len > i; ++i) {
     var item = info[i];
     var item_el = this.box.querySelector("#infobox_value-" + i);
     item_el.textContent = item.value;

     var name_el = this.box.querySelector("#infobox_name-" + i);
             console.log(name_el);
             console.log(this.data_template["items"][i]);

     name_el.textContent = this.data_template["items"][i].label + ": "; 
     name_el.appendChild(item_el);
   }
   // this.text_root.remove()
   // this.box.appendChild(this.text_root);
   // this.box.replaceChild(this.text_root, this.text_root.cloneNode(true))
   this.box.style.display = "inline";

   var bbox = this.text_root.getBBox();
   this.box.setAttribute("viewBox", "0 0 " + (bbox.width + 14) + " " + (bbox.height + 5) );


   this.fix_coords( event );
   // console.log(this.coords);
   // (this.coords.x).isNaN() 
   if ( "mouseenter" == event.type ) {
     this.box.setAttribute("x", this.coords.x + 5 );
     this.box.setAttribute("y", this.coords.y + 5 );

     this.follow_cursor( event );
   } else if ( "focus" == event.type ) {
     // console.log(event.type);
     this.move_box( event );
   }

 }

 infobox_obj.prototype.move_box = function ( event ) {
   var region = event.target;
   var bbox = region.getBBox();

   // this.coords.x = bbox.x + bbox.width;
   // this.coords.y = bbox.y;
   // this.coords = this.coords.matrixTransform(this.root.getScreenCTM().inverse());

   // this.box.setAttribute("x", this.coords.x);
   // this.box.setAttribute("y", this.coords.y );

   var root_vb_array = this.root.getAttribute("viewBox").split(" ");
   var box_vb_array = this.box.getAttribute("viewBox").split(" ");
   var box_bbox = this.box.getBBox();

   var x_shift = +root_vb_array[2] - ((box_bbox.x) + +box_bbox.width);
     // console.log("vb:" + +root_vb_array[2]);
     // // console.log(("box: " + (box_bbox.x) + box_bbox.width));
     // console.log("x: " + +this.box.getAttribute("x"));
     // console.log("width: " + box_bbox.width);
     // console.log("width: " + +this.box.getAttribute("width"));
   var x = bbox.x + bbox.width;
   if ( 0 > x_shift ) {
     x = bbox.x - +box_bbox.width;
   }
   this.box.setAttribute("x", bbox.x + bbox.width);
   this.box.setAttribute("y", bbox.y - 2 );
}

 infobox_obj.prototype.follow_cursor = function ( event ) {
   this.fix_coords( event );

   var root_vb_array = this.root.getAttribute("viewBox").split(" ");
   var box_vb_array = this.box.getAttribute("viewBox").split(" ");

   var x_shift = +root_vb_array[2] - ((this.coords.x + this.offset.x) + +box_vb_array[2]);
   var x = this.coords.x + this.offset.x;
   if ( 0 > x_shift ) {
     x += x_shift;
   }

   var y_shift = +root_vb_array[3] - ((this.coords.y + this.offset.y) + +box_vb_array[3]);
   var y = this.coords.y + this.offset.y;
   if ( 0 > y_shift ) {
     y += y_shift;
   }

   this.box.setAttribute("x", x);
   this.box.setAttribute("y", y );
 }

 infobox_obj.prototype.hide_info = function () {
   this.box.style.display = "none";

   this.hilite_clone.remove();
 }

 infobox_obj.prototype.fix_coords = function ( event ) {
   this.coords.x = event.clientX;
   this.coords.y = event.clientY;
   this.coords = this.coords.matrixTransform(this.root.getScreenCTM().inverse());
 }
